import axios from "axios";
import { useEffect, useState } from "react";

const bacadata = (name) => {
  const [data, setdata] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:3000/" + name).then((res) => {
      setdata(res?.data ?? []);
      console.log(res.data);
    });
  }, []);

  return data;
};

export default bacadata;
